(4852, 'deDE', 'Uralte Dinomanten glaubten einst, dass strahlend weiße Schuppen an Dinosauriern auf den Einfluss von Himmelskörpern hindeuten. Auf der Suche nach Gleichgewicht, haben sich die Lun\'alai diesen Vorstellungen hingegeben, als sie versuchten, den weißen Brutosaurus wiederherzustellen.', '|cFFFFD200Verkäufer: |rChurbro|n|cFFFFD200Zone: |rZuldazar|n|cFFFFD200Zone: |rHafen von Boralus|n|cFFFFD200Weltereignis:|r Zeitwanderung - Battle for Azeroth|n', 61609),
(4849, 'deDE', 'Diese winzigen Ernter werden oft während der Ebbe an Küsten eingesetzt, um Frachten und Hölzer zu sammeln, die von Schiffwracks an Land gespült wurden.', '|cFFFFD200Verkäufer: |rChurbro|n|cFFFFD200Zone: |rZuldazar|n|cFFFFD200Zone: |rHafen von Boralus|n|cFFFFD200Weltereignis:|r Zeitwanderung - Battle for Azeroth', 61609);
